import './css/App.css';
import Main from './views/Main';


function App() {

  useEffect(() => {
    var num = Math.floor(Math.random() * Math.floor(10));
    console.log("***********************************");
    console.log(num);
    console.log("***********************************");
});


  return (
    <div className="container">
      <Main />
    </div>
  );
}

export default App;
